import React, { Fragment } from 'react';
import PageTItle from "../../layouts/PageTitle";
import deleteIcon from '../../../images/icon/del.png'
import axios from 'axios';
import { useHistory, useParams} from 'react-router-dom';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';

const AddNewDay=()=>{
  
    return(
            <Fragment>
               <PageTItle activeMenu="Exercises" motherMenu="Form" />
      
               <div className="row">
              <div className="card w75 pb-5" style={{position:'relative'}}>
               <div className="card-header">
                     <h4 className="card-title">Editor Dia</h4>
                  </div>
                  <div className="form-group">
                                 <p className='input-label'>Description</p>
                                    <textarea
                                       className="form-control input-default input-border"
                                       placeholder="description"
                                       name='description'
                                       value={data.description}
                                       onChange={(e)=>setData({...data,description:e.target.value})}
                                       cols='10'
                                       rows='15'
                                    />
                                 </div>
                     <button className='mtb-3 submit-btn'  style={{position: 'absolute',bottom: '-1vw',right: '2.7vw'}}>Submit</button>
                  </div>
                  </div>
                  </Fragment>
    )
}


export default AddNewDay;
